import React, { FC } from 'react'
import FormOrder from '../components/Forms/FormUser/FormUser'
import ListOrder from '../components/Lists/ListOrders/ListOrder'
import { useDispatch } from 'react-redux'
import { orderRemove, quantityAdd, quantityLess } from '../store/orderSlice'
import FormUser from '../components/Forms/FormUser/FormUser'
import { addressChange, emailChange, nameChange, phoneChange } from '../store/userSlice'

const ShopCard: FC = () => {
   const dispatch = useDispatch()
  return (

    <div className='flex'>
      <FormUser
         nameChange={() =>dispatch(nameChange)} 
         emailChange={() =>dispatch(emailChange)}
         phoneChange={() =>dispatch(phoneChange)}
         addressChange={() => dispatch(addressChange)}
         orderAllRemove={() => dispatch(orderRemove)} />

      <ListOrder 
         orderRemove={() => dispatch(orderRemove)}
         quantityAdd={() => dispatch(quantityAdd)}
          quantityLess={quantityLess} />
    </div>
  )
}

export default ShopCard
